import React, { Component, Fragment } from "react";
import { Link } from "react-router-dom";
import PropTypes from "prop-types";
import Logo from "../img/login/logo.svg";
import LogoWhite from "../img/login/logo-white.svg";

// material ui
import withStyles from "@material-ui/core/styles/withStyles";
import AppBar from "@material-ui/core/AppBar";
import Toolbar from "@material-ui/core/Toolbar";
import Button from "@material-ui/core/Button";
import Alert from "@material-ui/lab/Alert";
import { IconButton } from "@material-ui/core";
import AccountCircleIcon from "@material-ui/icons/AccountCircle";
//redux
import { connect } from "react-redux";

// User menu component
import UserMenu from "./UserMenu";

import MediaQuery from "react-responsive";

// material ui style
const styles = (theme) => ({
  ...theme.nav,
  appbar: {
    [theme.breakpoints.down("sm")]: {
      background: "transparent",
    },
    marginTop: 48,
    [theme.breakpoints.down("xs")]: {
      marginTop: 68,
    },
    zIndex: theme.zIndex.drawer + 1,
  },

  logo: {
    [theme.breakpoints.down("sm")]: {
      display: "none",
    },
    width: "120px",
    height: "40px",
    align: "left",
    position: "relative",
    marginLeft: -10,
  },
  logowhite: {
    [theme.breakpoints.up("md")]: {
      display: "none",
    },

    width: "90px",
    height: "24px",
    align: "left",
    position: "relative",
  },
  covidAlert: {
    justifyContent: "center",
    zIndex: theme.zIndex.drawer + 1,
    position: "absolute",
    width: "95%",
  },

  covidInfo: {
    textDecoration: "underline",
  },
});
class Navbar extends Component {
  render() {
    const { classes } = this.props;
    const { authenticated } = this.props;

    return (
      <div>
        <Alert
          severity="error"
          component={Link}
          to="/covid19"
          className={classes.covidAlert}
        >
          <strong className={classes.covidInfo}>
            COVID-19: Information on Symptoms, Testing and Treatments
          </strong>
        </Alert>

        <AppBar className={classes.appbar} position="absolute">
          <Toolbar className="nav-container">
            <Button component={Link} to="/">
              <img src={Logo} alt="logo" className={classes.logo} />
              <img src={LogoWhite} alt="logo" className={classes.logowhite} />
            </Button>
            {authenticated ? (
              <Fragment>
                <UserMenu />
              </Fragment>
            ) : (
              <Fragment>
                <MediaQuery maxDeviceWidth={959}>
                  <IconButton
                    className={classes.iconButton}
                    component={Link}
                    to="/login"
                  >
                    <AccountCircleIcon
                      color="primary"
                      style={{ fontSize: 28 }}
                    />
                  </IconButton>
                </MediaQuery>
                <MediaQuery minDeviceWidth={960}>
                  <Button
                    className={classes.navButton}
                    size="small"
                    variant="outlined"
                    color="inherit"
                    component={Link}
                    to="/login"
                  >
                    Login / Sign up
                  </Button>
                </MediaQuery>
              </Fragment>
            )}
          </Toolbar>
        </AppBar>
      </div>
    );
  }
}

Navbar.propTypes = {
  authenticated: PropTypes.bool.isRequired,
};

const mapStateToProps = (state) => ({
  authenticated: state.user.authenticated,
});

export default connect(mapStateToProps)(withStyles(styles)(Navbar));
